import React from 'react';
import './Home.css';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/Timeline');
  };
  return (
    <div>
      <h1> Hello Home! </h1>
          <span style={{ color: 'blue', cursor: 'pointer' }} onClick={handleClick}>
            About Page
          </span>
    </div>
  );
}

export default Home;
